						<textarea id="docsrc" style="display:none">De merknaam Loxodon&#169; staat voor Loxodonta, dat in het Grieks Savanne-olifant betekent. Een mooie beeldspraak voor wie we zijn en waar voor we staan:

Just like this mighty giant, we are excellent team players, we display vigor, and we leave a unique imprint.

De merknaam Loxodon&#169; is eigendom van Loxodonta B.V. en heeft deze merknaam net als Lox-Engine&#169; geregistreerd in het merkenregister. De enig eigenaar van Loxodonta B.V. is dhr. M.J.M. Extra. Daarnaast is Loxodonta B.V. eigenaar van Loxodon B.V. en Loxodon Services B.V. Tussen de verschillende ondernemingen is geen fiscale structuur aangebracht. 
Loxodon B.V. heeft door de loop der tijd medewerkers in dienst genomen die veel kennis en ervaring hebben van Big Data en Artifici&#235;le Intelligentie. Deze medewerkers worden veelal ingezet bij Loxodon Services B.V. die licenties verkoopt aan klanten voor diensten die zij zelf bouwen en waarbij de &#8220;complexe engines&#8221; worden afgenomen van Loxodonta B.V.
Loxodon B.V. heeft zich in de loop der jaren gespecialiseerd in het werven van nieuwe medewerkers. Om kennis wereldwijd in te kunnen kopen heeft Loxodon B.V. zich bij de Immigratie en naturalisatiedienst aangemeld en heeft het voldaan aan alle kaders van de IND om als erkend referent beschouwd te worden. 
</textarea>
